import React from 'react'
import './timeboxes.css';
import {Form} from "react-bootstrap";
import {AddItem} from './../Board/Board.js'



class AddTimebox extends AddItem {
	addItem = console.log('abc');
	fromGroups = <Form.Group className='col-12' controlId="formTimeboxTitle">
				   <Form.Control type="text" onChange={event => this.setState({ newTimeboxTitle: event.target.value })}/>
				 </Form.Group>

}

class Timeboxes extends React.Component {
	render() {
		return  <div className='timeboxes-container col-6'>
				  <div className='component-container'>
				    <div className='component-title'>
				  		<span>Timeboxes</span>
				  	</div>
				  	<AddTimebox />
				  </div>
				</div>
	}
}

export default Timeboxes
